import React from 'react';
// to analyse the URL in order to customize the link if we are on the page the link leads to

import './NavLinks.css';


const NavLinks = props => {
return <ul className="nav-links">
    <li>
        <NavLinks to="/" exact>Find a Holidrink</NavLinks>
    </li>
    <li>
        <NavLinks to="/u1/events">Modify my Holidrink</NavLinks>
    </li>
    <li>
        <NavLinks to="/events/new">Create a Holidrink</NavLinks>
    </li>
    <li>
        <NavLinks to="/auth">Signin</NavLinks>
    </li>
</ul>
};

export default NavLinks;
